// Komponen HeatmapLayer yang lebih efisien dengan useCallback
const HeatmapLayer = ({ points, intensity = 0.5 }) => {
  const map = useMap();

  // Menggunakan useCallback untuk mencegah pembuatan fungsi berulang
  const createHeatLayer = useCallback(() => {
    if (!points || points.length === 0 || !map) return null;

    // Hapus layer heat yang ada sebelum membuat yang baru
    map.eachLayer((layer) => {
      if (layer._heat) {
        map.removeLayer(layer);
      }
    });

    // Buat heat layer dengan konfigurasi yang lebih responsif
    const heatLayer = L.heatLayer(points, {
      radius: 20, // Mengurangi radius sedikit untuk performa lebih baik
      blur: 8, // Meningkatkan blur untuk visualisasi yang lebih halus
      maxZoom: 12, // Meningkatkan maxZoom untuk detail lebih baik saat zoom in
      max: 1.0, // Nilai maksimum intensitas
      gradient: {
        0.2: "blue",
        0.4: "cyan",
        0.6: "lime",
        0.8: "yellow",
        1.0: "red",
      },
    });

    // Tambahkan heat layer ke peta
    heatLayer.addTo(map);

    return heatLayer;
  }, [map, points, intensity]);

  useEffect(() => {
    const heatLayer = createHeatLayer();

    // Cleanup function
    return () => {
      if (heatLayer && map) {
        map.removeLayer(heatLayer);
      }
    };
  }, [createHeatLayer, map]);

  return null;
};

// PropTypes validation
HeatmapLayer.propTypes = {
  points: PropTypes.array.isRequired,
  intensity: PropTypes.number,
};

