const PetaGangguan = () => {
  const [data, setData] = useState([]);
  const [startDate, setStartDate] = useState(
    new Date(new Date().getFullYear(), 0, 1)
  );
  const [endDate, setEndDate] = useState(new Date());
  const [showHeatmap, setShowHeatmap] = useState(false);
  const [showBoundaries, setShowBoundaries] = useState(true);
  const [heatmapPoints, setHeatmapPoints] = useState([]);
  const [mapInstance, setMapInstance] = useState(null);
  const [geoJSONData, setGeoJSONData] = useState(lombokGeoJSON);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Definisikan custom icon dengan memoryCache untuk performa
  const customIcon = useMemo(() => {
    return new L.Icon({
      iconUrl: markerIconPng,
      shadowUrl: markerShadowPng,
      iconSize: [25, 41],
      iconAnchor: [12, 41],
      popupAnchor: [1, -34],
      shadowSize: [41, 41],
    });
  }, []);

  // Style untuk GeoJSON dengan warna yang lebih menarik dan responsif
  const geoJSONStyle = useMemo(() => {
    return {
      color: "#2563eb", // Biru yang lebih modern
      weight: 3, // Sedikit lebih tipis untuk performa lebih baik
      opacity: 0.8,
      fillColor: "#3b82f6", // Warna fill yang sedikit berbeda
      fillOpacity: 0.1,
      dashArray: "",
    };
  }, []);

  // Fungsi untuk menghandleHoverStyle (dipisahkan untuk performa yang lebih baik)
  const getHoverStyle = useCallback(() => {
    return {
      weight: 5,
      color: "#ef4444", // Merah yang lebih modern
      dashArray: "",
      fillOpacity: 0.8,
      fillColor: "#f87171",
    };
  }, []);

  // Optimasi onEachFeature dengan useCallback
  const onEachFeature = useCallback(
    (feature, layer) => {
      const name = feature.properties.name || "Wilayah Tidak Dikenal";
      const popupContent = `<div class="font-bold text-lg">${name}</div>`;

      layer.bindPopup(popupContent);

      layer.on({
        mouseover: (e) => {
          const layer = e.target;
          layer.setStyle(getHoverStyle());

          if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
            layer.bringToFront();
          }

          layer.openPopup();
        },
        mouseout: (e) => {
          const layer = e.target;
          layer.setStyle(geoJSONStyle);
          layer.closePopup();
        },
        click: (e) => {
          if (mapInstance) {
            mapInstance.fitBounds(e.target.getBounds());
          }
        },
      });
    },
    [getHoverStyle, geoJSONStyle, mapInstance]
  );

  // Fungsi yang lebih aman untuk memproses lokasi
  const processLocation = useCallback((lokasiString) => {
    if (!lokasiString) return null;

    try {
      const coordPairs = lokasiString.split(",");
      if (coordPairs.length !== 2) return null;

      const coords = coordPairs.map((coord) => {
        const parsed = parseFloat(coord.trim());
        return isNaN(parsed) ? null : parsed;
      });

      if (coords.includes(null)) return null;

      return coords;
    } catch (error) {
      console.error("Error parsing location:", error);
      return null;
    }
  }, []);

  // Fungsi untuk memuat dan mengatur data GeoJSON
  const loadGeoJSONData = useCallback(async () => {
    try {
      setLoading(true);

      // Anda bisa menambahkan URL ke GeoJSON external di sini
      // Misalnya, untuk memuat dari URL:
      // const url = "https://example.com/path/to/your/geojson-data.json";
      // const data = await loadGeoJSON(url);
      // if (data) setGeoJSONData(data);

      // Untuk saat ini, kita gunakan data yang sudah ada
      setGeoJSONData(lombokGeoJSON);
    } catch (err) {
      console.error("Error loading GeoJSON data:", err);
      setError("Gagal memuat data peta. Silakan coba lagi.");
    } finally {
      setLoading(false);
    }
  }, []);

  // Memuat data GeoJSON saat komponen dimount
  useEffect(() => {
    loadGeoJSONData();
  }, [loadGeoJSONData]);

  // Fetch data gangguan dari Firestore
  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);

        const q = query(
          collection(db, "gangguanPenyulang"),
          where("tanggalGangguan", ">=", format(startDate, "yyyy-MM-dd")),
          where("tanggalGangguan", "<=", format(endDate, "yyyy-MM-dd"))
        );

        const querySnapshot = await getDocs(q);
        const dataGangguan = querySnapshot.docs.map((doc) => ({
          ...doc.data(),
          id: doc.id,
        }));

        // Mengurutkan data berdasarkan tanggal gangguan
        const sortedData = dataGangguan.sort(
          (a, b) => new Date(b.tanggalGangguan) - new Date(a.tanggalGangguan)
        );

        setData(sortedData);
        processHeatmapData(sortedData);
      } catch (error) {
        console.error("Error fetching data: ", error);
        setError("Gagal memuat data gangguan. Silakan coba lagi.");
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [startDate, endDate, processLocation]);

  // Fungsi yang lebih efisien untuk memproses data heatmap
  const processHeatmapData = useCallback(
    (gangguan) => {
      if (!gangguan || gangguan.length === 0) {
        setHeatmapPoints([]);
        return;
      }

      // Hitung frekuensi gangguan di setiap lokasi
      const locationFrequency = {};
      const validLocations = new Map();

      // Langkah 1: Proses lokasi yang valid dan hitung frekuensi
      gangguan.forEach((item) => {
        const lokasiKey = item.lokasiGangguan;
        if (!lokasiKey) return;

        const lokasi = processLocation(lokasiKey);
        if (!lokasi) return;

        // Simpan lokasi ke Map untuk penggunaan efisien
        validLocations.set(lokasiKey, lokasi);

        // Hitung frekuensi
        locationFrequency[lokasiKey] = (locationFrequency[lokasiKey] || 0) + 1;
      });

      // Langkah 2: Buat data point untuk heat map
      const heatData = Array.from(validLocations.entries()).map(
        ([key, coords]) => {
          // Dapatkan frekuensi dan terapkan normalisasi untuk visualisasi yang lebih baik
          const frequency = locationFrequency[key] || 1;
          const intensity = Math.min(Math.log10(frequency + 1) * 3, 10); // Skala logaritmik untuk persebaran yang lebih baik

          return [...coords, intensity];
        }
      );

      setHeatmapPoints(heatData);
    },
    [processLocation]
  );

  // Hitung jumlah gangguan per lokasi (untuk popup)
  const hitungJumlahGangguanPerLokasi = useCallback(() => {
    const lokasiCount = {};

    data.forEach((gangguan) => {
      const lokasiKey = gangguan.lokasiGangguan;
      if (lokasiKey) {
        lokasiCount[lokasiKey] = (lokasiCount[lokasiKey] || 0) + 1;
      }
    });

    return lokasiCount;
  }, [data]);

  const lokasiCount = useMemo(
    () => hitungJumlahGangguanPerLokasi(),
    [hitungJumlahGangguanPerLokasi]
  );
  const defaultLocation = [-8.647901, 116.532735]; // Lokasi default di Lombok

  // Komponen untuk menampilkan loading spinner
  const LoadingSpinner = () => (
    <div className="absolute inset-0 flex items-center justify-center bg-white bg-opacity-70 z-10">
      <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
    </div>
  );

  return (
    <Layouts>
      <div className="border-b border-main flex flex-col md:flex-row justify-between py-2">
        <span className="text-2xl font-semibold">Peta Lokasi Gangguan</span>
        <div className="flex flex-wrap gap-2 justify-items-center justify-end px-2 md:px-6 mt-2 md:mt-0">
          <label className="whitespace-nowrap">Tanggal Mulai: </label>
          <DatePicker
            selected={startDate}
            onChange={(date) => setStartDate(date)}
            className="bg-transparent border border-main rounded-md px-2 text-black max-w-32"
            dateFormat={"dd/MM/yyyy"}
          />
          <label className="whitespace-nowrap">Tanggal Akhir: </label>
          <DatePicker
            selected={endDate}
            onChange={(date) => setEndDate(date)}
            className="bg-transparent border border-main rounded-md px-2 text-black max-w-32"
            dateFormat={"dd/MM/yyyy"}
          />
        </div>
      </div>

      {/* Toggle Filters dengan layout yang lebih responsif */}
      <div className="pt-2 pb-2 flex flex-wrap items-center gap-2 md:gap-4">
        {/* Toggle untuk Heat Map */}
        <div className="flex items-center">
          <input
            type="checkbox"
            id="heatmapToggle"
            checked={showHeatmap}
            onChange={() => setShowHeatmap(!showHeatmap)}
            className="mr-2"
          />
          <label htmlFor="heatmapToggle" className="cursor-pointer">
            {showHeatmap ? "Tampilkan Marker" : "Tampilkan Heat Map"}
          </label>
        </div>

        {/* Toggle untuk Batas Wilayah */}
        <div className="flex items-center">
          <input
            type="checkbox"
            id="boundariesToggle"
            checked={showBoundaries}
            onChange={() => setShowBoundaries(!showBoundaries)}
            className="mr-2"
          />
          <label htmlFor="boundariesToggle" className="cursor-pointer">
            {showBoundaries
              ? "Sembunyikan Batas Wilayah"
              : "Tampilkan Batas Wilayah"}
          </label>
        </div>

        {/* Keterangan warna heat map yang responsif */}
        {showHeatmap && (
          <div className="text-sm text-gray-600 hidden sm:block">
            <div className="flex items-center flex-wrap">
              <span className="mr-1">Keterangan:</span>
              <div className="flex items-center flex-wrap">
                <div className="w-3 h-3 bg-blue-500 mr-1"></div>
                <span className="mr-2">Rendah</span>
                <div className="w-3 h-3 bg-green-500 mr-1"></div>
                <span className="mr-2">Sedang</span>
                <div className="w-3 h-3 bg-yellow-500 mr-1"></div>
                <span className="mr-2">Tinggi</span>
                <div className="w-3 h-3 bg-red-500 mr-1"></div>
                <span>Sangat Tinggi</span>
              </div>
            </div>
          </div>
        )}

        {/* Panduan interaksi */}
        <div className="text-sm text-gray-600 ml-auto hidden md:block">
          <span className="mr-1">Petunjuk: </span>
          <span>
            Arahkan mouse ke wilayah untuk melihat detail, klik untuk zoom
          </span>
        </div>
      </div>

      {/* Container peta dengan status loading */}
      <div className="pt-2 relative">
        {loading && <LoadingSpinner />}

        {error && (
          <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
            {error}
          </div>
        )}

        <MapContainer
          center={
            data.length > 0 && processLocation(data[0].lokasiGangguan)
              ? processLocation(data[0].lokasiGangguan)
              : defaultLocation
          }
          zoom={10}
          scrollWheelZoom={true}
          style={{ height: "800px", width: "100%" }}
          className="z-0"
          whenCreated={setMapInstance}
        >
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />

          {/* Tampilkan batas wilayah jika toggle aktif dan data tersedia */}
          {showBoundaries && geoJSONData && (
            <GeoJSON
              data={geoJSONData}
              style={geoJSONStyle}
              onEachFeature={onEachFeature}
            />
          )}

          {/* Tampilkan Heat Map Layer jika showHeatmap aktif */}
          {showHeatmap && heatmapPoints.length > 0 && (
            <HeatmapLayer points={heatmapPoints} />
          )}

          {/* Tampilkan marker jika showHeatmap tidak aktif */}
          {!showHeatmap &&
            data.map((gangguan) => {
              const lokasi = processLocation(gangguan.lokasiGangguan);
              if (!lokasi) return null;

              const jumlahGangguan = lokasiCount[gangguan.lokasiGangguan] || 1;

              return (
                <Marker key={gangguan.id} position={lokasi} icon={customIcon}>
                  <Popup>
                    <div className="text-sm">
                      <div className="font-bold">
                        Jumlah Gangguan: {jumlahGangguan}
                      </div>
                      <div>Tanggal: {gangguan.tanggalGangguan}</div>
                      <div>Penyulang: {gangguan.penyulang}</div>
                      <div>Penyebab: {gangguan.penyebab}</div>
                    </div>
                  </Popup>
                </Marker>
              );
            })}

          {/* Komponen untuk mengupdate posisi peta berdasarkan data terbaru */}
          <SetViewOnDataChange
            positions={
              data.length > 0 && processLocation(data[0].lokasiGangguan)
                ? [processLocation(data[0].lokasiGangguan)]
                : [defaultLocation]
            }
          />
        </MapContainer>
      </div>
    </Layouts>
  );
};

// Komponen tambahan untuk mengupdate view peta saat data berubah
const SetViewOnDataChange = ({ positions }) => {
  const map = useMap();

  useEffect(() => {
    if (positions && positions.length > 0 && positions[0]) {
      // Jika hanya ada satu posisi, set center
      if (positions.length === 1) {
        map.setView(positions[0], 10);
      }
      // Jika ada banyak posisi, buat bounds dan fit bounds
      else {
        const bounds = L.latLngBounds(positions);
        map.fitBounds(bounds, { padding: [50, 50] });
      }
    }
  }, [map, positions]);

  return null;
};

SetViewOnDataChange.propTypes = {
  positions: PropTypes.array.isRequired,
};

export default PetaGangguan;
